result = []

input_params.each do |params|
  puts "*********** Find contract with contract_number: #{params[:contract_number]} ***********"
  contract_id = params[:contract_id]
  lessor_id = params[:lessor_id]
  tenant_id = params[:tenant_id]

  contract = Domain::Contract::Model::Contract.find(contract_id)

  lessor_rep_ids = contract.lessor_representatives.map { |party| [party.contract_party_entity&.try(:id_number).present? ? party.contract_party_entity&.id_number : [party.contract_party_entity&.registration_number, party.contract_party_entity&.unified_number]] }

  if lessor_rep_ids.present?
    lessor_mismatch = !lessor_rep_ids.include?(lessor_id)
  else
    lessor_ids = contract.lessors.map { |party| [party.contract_party_entity&.try(:id_number).present? ? party.contract_party_entity&.id_number : [party.contract_party_entity&.registration_number, party.contract_party_entity&.unified_number]] }.flatten
    lessor_mismatch = !lessor_ids.include?(lessor_id)
  end

  tenant_rep_ids = contract.tenant_representatives.map { |party| [party.contract_party_entity&.try(:id_number).present? ? party.contract_party_entity&.id_number : [party.contract_party_entity&.registration_number, party.contract_party_entity&.unified_number]] }

  if tenant_rep_ids.present?
    tenant_mismatch = !tenant_rep_ids.include?(tenant_id)
  else
    tenant_ids = contract.tenants.map { |party| [party.contract_party_entity&.try(:id_number).present? ? party.contract_party_entity&.id_number : [party.contract_party_entity&.registration_number, party.contract_party_entity&.unified_number]] }.flatten
    tenant_mismatch = !tenant_ids.include?(tenant_id)
  end

  result.push([contract_id, lessor_mismatch, tenant_mismatch])
end

